import React, { useState, useEffect } from "react";
import FormDataForm from "./generalform";
import Table from "./tableComponent/table";

const Users = () => {
    const [dataUpdated, setDataUpdated] = useState(false);

    return (
        <div>
            <div>
                <Table
                    apiUrl="http://localhost:8080/user"
                    itemName="Users"
                    itemKeys={[
                        "firstname",
                        "lastname",
                        "password",
                        "email",
                        "isadmin",
                    ]}
                    customColumns={[
                        "First name",
                        "Last name",
                        "Password",
                        "Email",
                        "Is admin",
                    ]}
                />
            </div>
            <div>
                <FormDataForm
                    apiUrl={"http://localhost:8080/user"}
                    formFields={[
                        {
                            name: "firstname",
                            label: "First name",
                            type: "text",
                        },
                        {
                            name: "lastname",
                            label: "Last name",
                            type: "text",
                        },
                        {
                            name: "password",
                            label: "Number of employees",
                            type: "number",
                        },
                    ]}
                />
            </div>
        </div>
    );
};

export default Users;
